  `FMODEID` int(11) NOT NULL COMMENT '模型ID，对应EntityTypeEnum',
  `FCREATE_TIME` date DEFAULT NULL,
  `FUPDATE_TIME` date DEFAULT NULL,
  PRIMARY KEY (`FID`),
  UNIQUE KEY `NewIndex1` (`FGRABID`)
) ENGINE=InnoDB AUTO_INCREMENT=144 DEFAULT CHARSET=utf8mb4;

