  `FCREATE_TIME` datetime DEFAULT NULL,
  `FUPDATE_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`FID`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4;

